INSERT INTO `post` VALUES (1,'<p>&nbsp;</p>','2021-08-22 13:58:02.150000','<p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Chào các bạn. Mình là Tú admin Tu Shoes và hôm nay mình sẽ giải thích cho các bạn hiểu ntn là rep 1:1 và những vấn đề liên quan đến các chất lượng giày hiện nay. Cá nhân mình đã làm trong ngành này cũng 2 năm rồi và cũng hơn chục lần đi tham quan rất nhiều xưởng sản xuất và cũng đã trải nghiệm quá nhiều hàng real và rep 1:1 lẫn rất nhiều chất lượng khác rồi nên hôm nay mình sẽ giải thích rõ ràng nhất về chất lượng rep 1:1 cho các bạn hiểu.</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\">&nbsp;</p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\"><strong>Thứ 1: Rep 1:1 là gì ?&nbsp;</strong></span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Rep 1:1 là từ viết tắt của Replica 1:1 ám chỉ hàng fake được sản xuất cao cấp nhất, chất lượng tốt nhất và giống với real nhất. Nó có thể giống đến&nbsp;<strong>98%-99%</strong>&nbsp;hay có những bạn đánh giá nếu real được 10 điểm thì rep 1:1 sẽ được 9 điểm - 9,5 điểm.&nbsp;</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Về&nbsp;<strong>so sánh Rep 1:1 với Real</strong>&nbsp;thì khi mà các bạn không cầm trên tay 2 mẫu thì cực kì rất khó để so sánh hay nhận biết được nó là hàng rep 1:1 hay real. Phải những bạn chuyên gia kiểu cầm lên check thì mới biết được. Còn nếu bạn đi rep 1:1 ngoài đường thì không ai nói bạn đang đi 1 đôi giày fake cả. Kể cả những người tìm hiểu về giày và tiếp xúc thường xuyên như mình đây cảm giác nhìn nhìn 1 đôi rep 1:1 trên chân cũng khó có thể biết được đó là rep 1:1 hay real [ Mình nhắc lại là đã 2 năm và ngày nào mình cũng tìm hiểu về giày và tiếp xúc với giày ]</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Tùy vào mẫu thì các chất lượng rep 1:1 sẽ khác với chính hãng 1 số vấn đề sau [ form dáng , chi tiết tem, màu sắc ] Và lưu ý là các điểm khác này là rất nhỏ, hầu như nguyên liệu làm 1 chiếc giày rep 1:1 với real là giống nhau. Về màu sắc thì khác nhau rất ít chỉ có đậm hơn 1 chút hoặc nhạt hơn 1 chút rất khó để kiểm tra nếu bạn không có 2 đôi rep 1:1 và real để so sánh.</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Chính vì rep 1:1 rất khó check với real nên có rất&nbsp;<strong>nhiều cửa hàng mang tiếng bán giày chính hãng</strong>&nbsp;nhưng thực chất là đang bán rep 1:1 với giá giày real. Cụ thể các bạn tìm kiếm trên google từ khóa như những cửa hàng bán giày chính hãng lừa đảo sẽ ra 1 danh sách rất nhiều luôn nhé.</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Bên cạnh đó cũng có&nbsp;<strong>rất nhiều cửa hàng bán hàng kém chất lượng</strong>&nbsp;như những chất lượng fake 1, super fake tự nhận mình đang bán hàng rep 1:1 vì họ muốn lừa những khách hàng của họ là tôi là cửa hàng bán rep 1:1 rẻ nhất nhưng thực chất những thứ bạn nhận được chỉ là chất lượng kém. Về chất lượng kém chỉ cần mình nhìn lướt qua là có thể biết được chứ không phải giống với những sản phẩm rep 1:1 cao cấp rất khó để nhận biết đến nỗi có thể trộn rep 1:1 với real để bán.</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Vậy với những đặc điểm như vậy. Rep 1:1 so sánh với real sẽ đạt được 98% thì&nbsp;<strong>mức giá&nbsp;</strong>bán rep 1:1 sẽ rơi vào 1/2 cho đến 1/3 so với giá real. Vì chất liệu và độ tỉ mỉ rep 1:1 mang lại sẽ không hề có mức giá quá thấp. Và đặc điểm là rep 1:1 chỉ sản xuất những đôi giày giống real. Có nghĩa là khi real có phiên bản nào thì rep 1:1 sẽ mua sản phẩm đấy về và sản xuất phối màu và chất liệu chât lượng tương tự. Xưởng rep 1:1 sẽ không tự ý sản xuất ra những đôi giày mà không có hàng chính hãng để so sánh.</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\"><strong>Thứ 2: Những ai sẽ lựa chọn rep 1:1 ?</strong></span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Mình có tham khảo khá nhiều khách hàng lựa chọn rep 1:1 thành viên Tu Shoes thì mình nhận được rất nhiều những ý kiến về khách hàng tìm đến cửa hàng mình đa số về tiết kiệm chi phí cũng như là họ không thể tìm thấy những đôi giày real đó bán ở Việt Nam.&nbsp;</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Ví dụ như những đôi giày&nbsp;<strong>Yeezy&nbsp;</strong>được sản xuất số lượng hạn chế [&nbsp;<strong>limited</strong>&nbsp;] khó có thể mua được ở Việt Nam cũng như là % cao mua được giày rep 1:1 với giá 8-15tr là rất cao nên họ quyết định chọn đến rep 1:1 real boost với giá bằng 1/3 với ~3tr . Hay những dòng&nbsp;<strong>Vans vault&nbsp;</strong>cứ được&nbsp;<strong>Restock&nbsp;</strong>[ Làm lại ] bán chính hãng ở Việt Nam thì không thể mua được nên khách hàng sẽ lựa chọn rep 1:1 với giá = 1/3 khoảng ~800k - 900k. Vì Vans Vault cực kì khó mua và có mức giá từ 2tr4-3tr5 tùy phiên bản nên những cửa hàng mang rep 1:1 bán giá real sẽ rơi vào giá hơn 1tr để lừa khách hàng thì các bạn nên cẩn thận và check kĩ cũng như là nên tránh những cửa hàng đã từng bị phốt.&nbsp;</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Tiếp đến khi mình quyết định chỉ mang&nbsp;<strong>chất lượng tốt nhất</strong>&nbsp;đến với khách hàng cũng là lúc nhiều cửa hàng bán hàng Super fake cũ cũng như bán hàng fake 1 cũ với mức giá 300k - 1tr / 1 sản phẩm cũng đã nói đó là hàng rep 1:1 dẫn đến việc có quá nhiều người loạn về hàng hóa không biết và hiểu rõ rep 1:1 là gì? Các bạn có thể để ý đến cách đây 2 năm mình đưa rep 1:1 lên và kể từ lúc đó rep 1:1 thành trào lưu của tất cả mọi người :\"&gt;.</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\"><strong>Thực tế bán hàng chuẩn rep 1:1 ở Việt Nam</strong>&nbsp;theo mình được biết còn chưa có đến 5 cửa hàng. Vì đơn giản người Việt Nam chỉ thích những hàng rẻ và không quan tâm về chất lượng. Chỉ để ý 2 mẫu giống nhau nhưng không biết thực chất là 2 sản phẩm chất lượng khác nhau và khách hàng sẽ lựa chọn rẻ hơn. Và thực tế thì cửa hàng mình đã bị rất nhiều cửa hàng khác ăn trộm ảnh, chỉnh sửa ảnh và xóa toàn bộ logo của Tu Shoes trên hình ảnh và chèn vào đó là icon.</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\"><strong>Kết Luận:</strong></span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Trên đây thì mình không có khuyên bạn phải sử dụng hàng này hay hàng kia. Tùy vào mục đích sử dụng của các bạn thì các bạn sẽ chọn những sản phẩm phù hợp. Các bạn là khách hàng và các bạn xứng đáng nhận được những gì tốt nhất cho sự lựa chọn của các bạn. Mình chỉ nhắc các bạn là chất lượng đi kèm với giá cả và đừng để người khác lừa bạn vì họ là những người không đủ để các bạn tin tưởng gửi gắm.&nbsp;</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Chân thành cảm ơn các bạn đã xem bài viết đánh giá của mình. Có góp ý gì hay hỏi đáp gì các bạn cứ cmt bên dưới mình sẽ trả lời cho các bạn bằng tất cả khả năng kinh nghiệm của mình. Đừng quên mình cũng nhận check giày giúp các bạn nha. &lt;3</span></p>',NULL,'2021-08-22 13:58:02.150000','giay-rep-1-1-la-gi-co-nen-chon-giay-rep-1-1-giay-replica-va-replica-1-1-va-lua-ao-ban-giay-replica',1,'/media/static/4c48ecde-7f9d-43ff-8e4a-33775902dbd9.jpg','Giày Rep 1:1 là gì? Có nên chọn giày rep 1:1? Giày replica và replica 1:1 và lừa đảo bán giày replica ?',1,NULL),(2,'<p>&nbsp;Adydydydyyd</p>','2021-08-22 13:59:40.506000','<p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"font-size: 18px;\"><u><span style=\"font-weight: 700 !important;\"><span style=\"color: rgb(0, 0, 0);\">Vì Sao Giày Chuẩn Rep 1:1 Tu Shoes Lại Rẻ Nhất ?</span></span></u></span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: 700 !important;\">1. Nhập hàng trực tiếp từ nhà máy.</span></span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Toàn bộ sản phẩm Tu Shoes đều được nhập trực tiếp từ nhà máy. Không thông qua trung gian cũng như là kiểm tra về chất lượng sản phẩm nghiêm ngặt qua nhiều bước nên Tu Shoes luôn cam kết mang đến chất lượng tốt nhất với giá tốt nhất.</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: 700 !important;\">2. Đúng Giá Đúng Chất Lượng [ Nói Không Với Lừa Đảo, Bán Hàng Rác , Trộn Hàng Hoặc Đôn Hàng ]</span></span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Mọi người hay so sánh đặt câu hỏi là vì sao cửa hàng này đắt hơn cửa hàng khác 200k, 300k hay thậm chí là 500k ? Đơn giản vì&nbsp;<span style=\"font-weight: 700 !important;\">chất lượng hoàn toàn khác nhau</span>&nbsp;. Tu Shoes đã làm việc trong ngành giày hơn 3 năm và hiểu rõ điều này. Nếu cửa hàng khác bán chất lượng tương tự mà giá rẻ hơn rất nhiều vậy tại sao Tu Shoes không sang bên cửa hàng đó nhập hết hàng bên đó về và bán giá cao để kiếm lời ? Chỉ đơn giản là&nbsp;<span style=\"font-weight: 700 !important;\">chất lượng hoàn toàn khác nhau cho nên giá tiền cũng hoàn toàn khác nhau&nbsp;</span>và những cửa hàng bán hàng rẻ tiền quảng cáo chất lượng Rep 1:1 chuẩn là đang&nbsp;<span style=\"font-weight: 700 !important;\">lừa đảo khách hàng.</span></span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\">&nbsp;</p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: 700 !important;\">Ví Dụ:&nbsp;</span>Khách hàng đặt 1 sản phẩm A của Tu Shoes thì shop sẽ mất thời gian khoảng 7-10 ngày để sản phẩm đó có thể vận chuyển từ&nbsp;<span style=\"font-weight: 700 !important;\">Nhà Máy&nbsp;</span>về đến shop để giao hàng hóa hay sản phẩm chất lượng cho bạn khách hàng.</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Nếu những cửa hàng khác&nbsp;cũng bán hàng rep 1:1 chất lượng tốt mà giá rẻ tại sao bên shop không qua đó lấy hàng chất lượng tốt giá rẻ như quảng cáo để trả hàng cho khách, không phải bắt khách đợi 7-10 ngày nữa&nbsp;?&nbsp;<span style=\"font-weight: 700 !important;\">Chỉ đơn giản là những cửa hàng đó đang lừa đảo khách hàng và hàng hóa đó không đủ tiêu chuẩn Rep 1:1 như đã quảng cáo để mang đến cho khách hàng những chất lượng tốt nhất.</span></span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: 700 !important;\"><u>Vì thế đúng giá rẻ nhất và đúng chất lượng tốt nhất chỉ có tại Tu Shoes</u></span></span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\">&nbsp;</p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: 700 !important;\">3. Cửa hàng Uy Tín.</span></span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;Với 1 cửa hàng uy tín thì thực hiện đầy đủ cam kết với khách hàng từ bảo hành hàng hóa, đổi trả hàng hóa cũng như việc nâng cao chất lượng phục vụ là điều quan trọng nhất.</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Với TuShoes bạn có thể:</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;-&nbsp;<span style=\"font-weight: 700 !important;\">Đổi Hoặc Trả</span>&nbsp;sản phẩm trong 7 ngày [ Với giày chưa sử dụng không kể lí do&nbsp;]</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Bạn sẽ có 7 ngày để kiểm tra chất lượng sản phẩm, bạn có thể mang giày đi mọi cửa hàng khác để có thể so sánh về chất lượng, so sánh về giá và nếu bạn thấy bên cửa hàng Tu Shoes sai về cam kết chất lượng tốt nhất giá tốt nhất thì bạn cứ mang trả lại cho Tu Shoes.</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">-&nbsp;<span style=\"font-weight: 700 !important;\">Bảo hành 1 đổi 1 t</span>rong 3 tháng với lỗi từ nhà sản xuất</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Với bất kì lỗi nào từ nhà máy như chất lượng không đảm bảo dẫn đến việc bung keo thì bên mình hỗ trợ nhận lại giày và đổi cho khách hàng sản phẩm mới.</span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">-&nbsp;<span style=\"font-weight: 700 !important;\">Hỗ trợ bảo hành và sửa chữa miễn phí</span></span></p><p style=\"margin-bottom: 10px; color: rgb(125, 125, 125); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Với những sản phẩm sau 3 tháng mà gặp lỗi từ giày thì bên shop vẫn sẽ nhận về và hỗ trợ sửa lại giày miễn phí cho khách hàng.</span></p>','2023-10-18 02:00:33.387000','2021-08-22 13:59:40.506000','giay-rep-1-1-chuan-gia-re-nhat-tu-shoes',1,'/media/static/23846b4d-4790-4b04-b3ab-9b4e05f58ad8.jpg','Giày Rep 1:1 Chuẩn Giá Rẻ Nhất - Tu Shoes',1,6);
