ack onto the streets, its padded collar lets you take your game anywhere—in comfort.</p><p><strong>Benefits</strong></p><ul><li>The textured leather upper ages to soft perfection.</li><li>Foam midsole offers lightweight, responsive cushioning.</li><li>Rubber outsole with hoops pivot circle adds durable traction and heritage style.</li><li>Colour Shown: Deep Jungle/Light Silver/Deep Jungle/White</li><li>Style: FB8896-300</li><li>Country/Region of Origin: Vietnam</li></ul><p><strong>Nike Dunk</strong></p><p>From backboards to skateboards, the influence of the Nike Dunk is undeniable. Although introduced as a basketball shoe in 1985, its flat and grippy soles were perfect for a neglected sport community—skaters. Uncovering a subculture craving creativity as much as function, the Dunk released decades of countless colourways that continue to capture the soul of skaters from coast to coast.</p>',NULL,'[\"https://storage.googleapis.com/shoesimagesapi.appspot.com/70985-35cd473e-b388-4de0-83f5-8a8f3287eef6.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730637787&Signature=d%2BBfVSTyR4xogIzEmlmkj3hgatHQE7MGTVjg6Znl2Tvua%2FVu1PnnJ8CJbVzGxPnIlC8riZEdwBT%2FG3seNpgOJzaRk6eX2U8ksP7zghliT1y3vY5JntJVINJclqYhWMk0F%2Bph%2FQHbjgbfsTTM0sExetHV8Ad%2F7t3OHB2CnBjrqZtzRt%2BhHpN6a%2B0jLfloqh%2Bl3HO3mNMKCKi0sykLWlJUFbaG8zpKW1eQGIg8rMlIc%2BxC3TlDeubtEZnxitXu%2FaPXwCK806xXv9pcLsC5EGLMVXVlZo8abs0mXVoXlKpXYfkOLUiZPbTljugRvYGWYZpTcH5ToeMxFdO3PtW5gwbUPA%3D%3D\", \"https://storage.googleapis.com/shoesimagesapi.appspot.com/70988-14203544-65f0-4698-b962-fcb288206453.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730637789&Signature=L9m%2FWdU7uOLFs36DRjkTNzhC6XBgW4l%2B1WaGlzfI3kIQHjaycTl9WG%2BQw%2B1ZXkybHX5M8DLnfxP0OzFyePhDsu6aCy5XZ%2F%2Be3RASXpR9KngyfxKWq64nFjkYgKLEGdpFYsIGIRBoT2XuNnnbrYVL0%2FSwtXZweBzsIRZwOhm4WflxJfhBRmRVBBx4qJEghgYRx%2FuHEaS4bGRrdCHY9sQcLJz9EklCGg3cAOdgCrZvJ3aaSPbxKEZIPBLqVu4g%2FQSKCFXm%2B9Icrhu