l team. Of course, the design improved over the years, but the name stuck. The Nike Blazer Mid \'77 Vintage—classic since the beginning.</p><p><strong>Benefits</strong></p><ul><li>Leather and synthetic upper keeps the classic look of the original while adding comfort and support.</li><li>Vintage treatment on the midsole provides an old-school look.</li><li>Autoclave construction fuses the outsole to the midsole for a streamlined look that echoes the \'70s design.</li><li>Exposed foam on the tongue provides a throwback look.</li><li>Non-marking, solid-rubber outsole has had the same herringbone pattern from the start, because why change what works? It\'s excellent traction and durability that leaves the imprint you love.</li><li>Colour Shown: White/Black</li><li>Style: BQ6806-100</li><li>Country/Region of Origin: Vietnam,Indonesia,India</li></ul>','[]','[\"https://storage.googleapis.com/shoesimagesapi.appspot.com/73316-fb7eda3c-5ac8-4d05-a18f-1c2c5e82e36e.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730640118&Signature=TIhsK2siRLoHckDJpGsKuWqJkSdOoNIstxOPi8E7aWnYaf6OQ333HS%2BsScOnh2ufeuZ%2BXmrxMGjJRAGnslbusLVyWvo%2B7hKmwv8eGO5ZObRKVW9kDoSIUkYde%2FI9ZlPdg35q47egnB1cv22fjz645XzrRhNuvpZqRKi%2FJqPZqSBnLilZDsdp8QW4sdDoqNRKeJNQc%2B%2B8PG9rANvO912HkLs3FILeWnIlKXcCfqoWPaizOgx228LNkUn01Fl6FnJ2KLX3vUPSwjmp4Z7GWLIaTOy9TFy2K4qCQMfnOjxh7qGg2ylfTJGSNULU5rXDN72P6MdC3%2ByvLbcIkGw0EU8v%2Fw%3D%3D\", \"https://storage.googleapis.com/shoesimagesapi.appspot.com/73318-cacf1d36-8769-41b2-8616-a351efae9ce5.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730640119&Signature=N9Oscs9cbkJ%2BA1FA%2FgyE3w8EHDZUc7HCR57rooeKpe%2BcbLvmvj8DMhHE277c%2Bk5eHN8T%2FVRDCL1UbMzEfKovtOKYlJoCVbG02XtDaffla%2BVjs9eQWe1%2BNj%2FQSHW60KUuncximVHxIvcdAyTxipTbQfBgDpF5YqXsViE%2BbqmRf1cKr%2F1JlkTgo4x6S0VM8JaVkerReOxAzrpxwIKju2X2S%2FyOkuL%2B7BTC76IfQEr11eniDFxryu%2BiPST847triHm8uYTy0FTJLyiKQDXibNRWtEZeDCXWHLtMOzP1kXtAQwGj1PoFxWLfXL