imagesapi.appspot.com/73757-1a0d2f2d-9a70-4012-b831-5c4099269868.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730640558&Signature=eUNAjHv9QuFXUGHNr%2BU6ZY4omWvxSx7KcckoOwlQaDB5dfkzIkwIcR01dx7HEyrBfW5Y%2FVL7L3PlgLX3V3LFyLBoq7ubNZ40nVLDmuLXeIEBUX6DMrmnGx6UQQAcoPmnkxMTojaEuPLGpq64%2ByFidNrlBwEPTuUlg6rSSkf%2FXrL3x%2BcUKwdor4yVVAo%2BL%2FSaolPw7xHi9DLiXZAtD9OBEj%2FDaQsitswIoNjzdF737qsg9vk%2FBmzRmf3XVyKOwjeHXArXmXOK%2FrHbHriElPYc5A7z0AC%2FSDUSfHHoevUVwNezG49itZvMccLQKGxHGFnhueWa%2F8iBA%2FP1xEjxn4Hhcw%3D%3D\", \"https://storage.googleapis.com/shoesimagesapi.appspot.com/73759-d3efd6af-de7e-4ee1-ab9f-4e336f40e1bc.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730640560&Signature=DEWPZzepfeHvAHjchvG9%2FBfp%2BxsOOWLMm9BA%2F1UDcGJy%2B%2FIDKGDZHvQrSAnhRxOrJuq1n0ZF4ITKxRwMXDY3EWt%2BEzZIWcRQLRBw1zOEvp37iFvo7oqX3LzcGXyTsrh9KkNsbTQrXlYHrX8f452HMBGG%2ByS6dMJ1VTN6MwAwtLPk95FzkNEMVFE7%2BbPtNxnGa9LI6CY0%2ByXtiKQauZH49RpxmX%2FXE%2BKJHyiEtHXbxkagYXAS2dYLLV5DCSP6Y47rvcTUgoeFVdDXRzgP7WEXVCnpunY6i443fyKjouKCraAI8%2FHXjjc2Ebra0b%2Fss5icLiwl0%2BsTGnt6U0qAdA5CUA%3D%3D\"]','2023-11-04 13:29:22.783000','Nike Court Vision Alta',1189000,2189000,'nike-court-vision-alta',1,0,0,4),('Hzl3m5','2023-11-04 13:11:40.919000','<p>Bridge the gap between your weekend training run and race day in a durable design that can be deployed not just at the starting line of your favourite race but in the days and months after your conquest. It offers comfort and reliability but with a propulsive sensation that\'ll help you feel fast and fresh. That kind of versatility is uncommon in the running arena. But who said you can\'t have it all?</p><p><strong>More Bounce</strong></p><p>Newly implemented ZoomX foam in the midsole takes an already respected, trusted shoe to another performance level that wasn\'t present in the Zoom Fly 4. The addition makes for a lighter, more responsive cushioning system. Take advantage of these all-purpose traits that help you run easier and faster and have more fun on your runs.</p><p><strong>Stability Where You Need It</strong></p><p>Both the forefoot and heel offer slightly wider bases for a stable platform, so you can tackle turns and long runs with confidence.</p><p><strong>Stay in Rhythm</strong></p><p>Carbon-fibre plate delivers a propulsive sensation and a smooth transition at a variety of paces. The plate provides a sort of roll-forwards feel that makes you want to take on the next step.</p><p><strong>More Benefits</strong></p><ul><li>The upper is made from lightweight mesh for a softer, more breathable feel that contours to your foot.</li><li>Dynamic lace-up fit and supportive containment in the midfoot wrap around your foot for a contoured and secure fit.</li><li>Colour Shown: Barely Green/Clear Jade/Light Ultramarine/Deep Jungle</li><li>Style: DM8968-302</li><li>Country/Region of Origin: Vietnam</li></ul>',NULL,'[\"https://storage.googleapis.com/shoesimagesapi.appspot.com/72636-43be8545-4e48-45c2-8d49-ba3b8ef7342d.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730639437&Signature=VpsRciTyPsHr6K79rwtXYRtgOG3iVZled1fjQi4SRQ3LoL1L30Bq8bNWIc2JiTR8yufaZZzBArZS2L9NqE89gh5PKOXOt7e9HMxFyjaAM1EoKPb7btT2x3sbnLQJ4rynQjBrr0kaYidBWUsfSm11YMBqz5I%2FFJ0vBnmEyoP9PSuvmtvDWVAtyhAc1XAx3YcysvySqxsaabKsn61H1iPVoKSxMQ7poQj%2ByQXAqp5pobnOYKD%2B5C2PnlwZdYCYBkh4mBjJqs5blSp%2FpdnkPm7%2BW0Pdc1gMby%2F4Q%2FfeAqGvaH%2BYzBYRTkOGBI6%2BoHciZjtglDjzbfeqkF5R4cbHS4oCnw%3D%3D\", \"https://storage.googleapis.com/shoesimagesapi.appspot.com/72639-1631873c-710a-4a22-8fcd-f544f7987dcc.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730639440&Signature=uL2KeigoOQJdRah4HJlHfnJsOHgDIAKVxq26O%2FETNiqO98RwML68IkreIjxPjc0macc%2FsIs2G9GOEEuIqm1fIWh73Ig%2FJhejeZMFuxAjLzsprCJ6R0Pq%2FidoqW%2BLzOzfFe2KqEOvr3se%2FIXI7AnRVPJSW%2BDof1qLwR%2FC7pjbPSHy7VCPg%2BulUx4MYCqeEZHwCNC8kdFHVV8XxxEOeuL8r8kROIOgY4DRs3Ipl3gUFxQOMEP3hVRQNq