','2023-11-04 13:15:40.534000','<p>Take a deep breath and slip into a minimalist look with maximalist comfort. Its contoured design is created from a single piece of foam for a smooth, seamless feel. Plus, the water-friendly foam has a textured footbed that provides grip even when wet—making them a versatile option you can take anywhere. You get all of the style, none of the effort. It\'s time for some Calm.</p><p><strong>Customisable Comfort</strong></p><p>The soft yet responsive foam provides amazing comfort, no matter where your day takes you. Plus, there\'s a removable heel strap so you can switch up your look.</p><p><strong>Water ready</strong></p><p>The outer shell is made from water-resistant foam that is easy to clean. A subtle textured pattern on the footbed helps keep your feet in place—even when wet.</p><p><strong>Made for Every Day</strong></p><p>Full-rubber outsole provides durable traction. The side cut-out adds just the right amount of breathability.</p>','[]','[\"https://storage.googleapis.com/shoesimagesapi.appspot.com/72879-f9f5eb70-3982-49ce-8dbe-2d53f1fc4013.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730639681&Signature=OQ2VCaZWASfQOIr6lotr3tTtdaHxIvNhX8UwCpQc2%2FFUrvXZDGxkwxa1FIdBLvTnesUkoB7gQXwli%2BXtef7WpZsKYCpz789yqcNamkh%2FO1a6t2fUKTRsBh0WiHqP0SSOUuTIGd08dZ95vFoPZfkkC4djurD%2Fcd490k6XgU2rj8ih%2F7ehtJpHmYs0bUvIclDgYgXZLA3Y3jGFPUxNZzQAqZarLYLLuG%2F5ZaeZesTesAfIN2AKIQjXOxbKctRv2DfFt98Oi7kVEj227OSnPpdqSYT%2FOI6OdY1T9GcjX644oDEV6VfBQR11%2BG9N8rFHWEy9%2BefPY01EAIxnvaz2dKSXFw%3D%3D\", \"https://storage.googleapis.com/shoesimagesapi.appspot.com/72882-4c3ce1c6-fa29-4b9b-9070-0f7abaead22a.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730639683&Signature=A%2BLdWeaUz%2FKH6jOf2Z8W4fgC6hpHgDi1quyaFxRUu9uMK9U08BvZj4TXyHY9gpmyu7vUpVAoP8TEzsM4q9JINzaMJ6j0SDRENJyjKm2TYLGUGtB9sc8dFajPQXiTDxJ0Q1EmPUGZsF%2BgqfRll5WGF%2Bk4a0U4JhHvPSZviDUz3pChqEB%2B6pR0uvxwNzzjT5Oz%2B6p3I3