i>Textile upper</li><li>Leather and synthetic overlays</li><li>Foam midsole</li><li>Not intended for use as personal protective equipment (PPE)</li><li>Colour Shown: Stone/Light Bone/Summit White/Stone</li><li>Style: DZ3544-200</li><li>Country/Region of Origin: Vietnam</li></ul><p><strong>Nike Air Max Origins</strong></p><p>Revolutionary Air technology first made its way into Nike footwear in 1978. In 1987, the Air Max 1 debuted with visible Air technology in its heel, allowing fans more than just the feel of Air cushioning—suddenly they could see it. Since then, next-generation Air Max shoes have become a hit with athletes and collectors by offering striking colour combinations and reliable, lightweight cushioning.</p>',NULL,'[\"https://storage.googleapis.com/shoesimagesapi.appspot.com/71173-493f87d4-86f9-4fc5-8c63-ceff5b81a643.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730637975&Signature=Po7CrdpnFb5RrdZXV%2FXnJIBSFolEHLq26OgSmnYV59ZBQ7POTF%2B9EUA2G6qLsasAFAAdbYldoThBCQOITCln0yeWBAdmHEbLeIcO5NRJqb2ujhnFQdBCJBuQ1%2B8CPUoO4GWpWTfE4Kbop4A4VlCol1%2FwT6rPtS0ExE%2F7KqDNjEEp1YX8LH0%2BCO3eP0t2AwF8kEPGC6X4aaKZdVJ6hAslh%2BC5uppd80Oeo7dAKY99H7YJIZ7OF6c9ojNchAQ3oXfUEvFFOAHxlDTU9DW1qvLtlmQVSWSrNaXFyOSxPRGrC9YybUJRCcuKawEzn2c9aamj8Qa994AZWZ5iGN%2Fy7CBCyQ%3D%3D\", \"https://storage.googleapis.com/shoesimagesapi.appspot.com/71176-db2d283f-9582-4f3a-8d2f-80beea31d584.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730637976&Signature=sGpmrQhzfyA1yU%2Fof2CP08f3D0h%2B9Cq6kgdMudbJHxzuhE0yTZ60qNyDv9082LwKoX5BP562w5fCRfD15vVpEGYg3r%2F4X3t5OhXBXiydO0N%2F34thznjqzEIlusN74arYKaEXhmU6Gldy15iTKhUEHrpYDRRQ7PpYtGFvaYcZqBAWIXc%2FhoozEPys3B19ALCeyJqrrW3hdqgt%2B4OfZueERRUVso0nUjmySD4s%2B7241we7Y9mw1k8b%2BqQRFiRlOwlE74Lnp5GoHGUuu7vDCKbMYwtE3NLJQg5pjDRj%2Br0d%2FQa91f7WtE68Hnxbw95hkOwOts9VCVHLeyHfG%2Fu8JX0ZmQ%3D%3D\", \"https://storage.googleapis.com/shoesimagesapi.appspot.com/71177-95d364a0-7c17-4821-9318-cd