Origin</strong></p><p>In 1971, Nike co-founder Bill Bowerman was watching his wife, Barbara, make breakfast on a waffle iron and inspiration struck. He swapped batter for rubber and the Waffle outsole was born. It not only delivers traction, durability and heritage Nike style—it proves that greatness is in the everyday. And that old, rusty waffle iron? Well, it now sits on a pedestal at Nike World Headquarters.</p>','[]','[\"https://storage.googleapis.com/shoesimagesapi.appspot.com/70525-1b629b25-26ec-4d73-a330-da71843d3018.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730723727&Signature=laWbiQeNlry%2FudfOzASYJMsLPAGv7m6VGxFgTxQF%2FGBfWjwlGcdomA%2F01J%2BzV%2BWB3vz0gu72o9yJv9Mvvilimhh6jPSnvVXuHXsNJ%2FMjtY0zcPDO7z4W47c5iyJy0P%2F3QBI3SlAQ9sh%2Bm3QIYptgSt%2BARqaqZQWXzXYAx2u5mey9Y%2FOgJPaqORiZaiWkvBGIbf5EAeTBV4BiDqzjZIf7nI0GbEJsStqAPnspLBjhNaq0CdlgawUcuFmn%2BOME3RX%2F2jW7jIv3BqZwFMzU49cg0suxzRvYvvTk8XQTAmO4vb8B0ed1BbaizhUGLB%2FNOl2FrcqO4q616W9%2Fnfc%2BxNgIZg%3D%3D\", \"https://storage.googleapis.com/shoesimagesapi.appspot.com/70528-071862b5-b90e-47ad-9c8b-744dc7bf2b11.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730723728&Signature=k4mSPAc8ieZREunXE3Rcp8JWBiox%2FiKlwnGxoQixsc5Le%2Fm8wBTKkO0ifcrdThBR80fD%2BLl9%2FwAQcvkBmKSxjFdkck9n4EUq2kGHqg5vEhVIoe0dxnnk13A9R2pgzL%2BNn1Uk3lcXDfxTGtQULrTMiepnyo%2B%2BkhO5Mr7MHnNIxkqSi1rg%2FNZp3Tjr%2FfV6DGU1hs%2B5sZ4O%2BOd2dgH6taJtHqBVb7TxUr8NWEm8QsJp0mpKAUf9Aa2%2F0FYaCQeaS9xgK9CeV7SyZ1IzlC%2FtGWw2fuYP8gh9tFUfH%2FXIdlvmiID2DTdvBoOSAsTstRMPfUuOkj1om8bO7icU0E0c5RMclw%3D%3D\", \"https://storage.googleapis.com/shoesimagesapi.appspot.com/70530-57bf2017-959c-43c4-a31e-2bc91af0a9f6.jpg?GoogleAccessId=firebase-adminsdk-7x40a@shoesimagesapi.iam.gserviceaccount.com&Expires=1730723730&Signature=N8oFzQ8cXPkGCewqMh1gcFh1%2BT45NmKzO5jv1iTzgaT2fO8NdUxWih2FPL%2Fz9gKZdGMun0Ba8aAtbD77wf2s0l4HOiC5GH42ZEelRxkD5OAcf4gg4FydsUKEf4lbtABKiKWOXxFqEiK6CKPNeK0c3yCXbHThjP5Nk%2BU